class Day5Challange1(ChallengeIf.ChallengeIf):
    def __init__(self):
        self.TestInputs = ["dabAcCaCBAcCcaDA"]
        self.TestOutputs = [10]
        self.Input = ""

    def Run(self, arg):
        ord_list = [ord(a) for a in arg]
        while(True):
            index_to_rm = []
            for i in range(len(ord_list) - 1):
                if len(index_to_rm) > 0 and i == index_to_rm[-1] + 1:
                    continue
                if abs(ord_list[i] - ord_list[i+1]) == 32:
                    index_to_rm.append(i)
            reduced_elems = 0
            for i in index_to_rm:
                true_index = i - reduced_elems
                ord_list = ord_list[0:true_index] + ord_list[true_index+2:]
                reduced_elems += 2
            if not index_to_rm:
                break
        return len(ord_list)

